import React from 'react';
import {Link} from 'react-router-dom';
import './Homepage.css'

const HomePage = ({AppProps}) => {

    const dogs = AppProps.dogs
    return (
        <div className="dogs">
        {console.log(dogs)}
        {dogs.map(d => (
            <div className='dog'>
               <img className="images" src={d.src}/>
               <Link className="link" to={`/dogs/${dogs}`}>
                    <h1>{d.name}</h1>
               </Link>
            </div>
        ))}
        </div>

    )
}

export default HomePage;
